$(function(){App.init();App.initLeftNavAjax(window.activeURL,null);App.bottomFloat(".pagination");App.bottomFloat(".form-submit-group",0,true);if(window.errorMSG)App.message({title:App.i18n.SYS_INFO,text:window.errorMSG,class_name:"danger"});if(window.successMSG)App.message({title:App.i18n.SYS_INFO,text:window.successMSG,class_name:"success"});App.notifyListen();$("#topnav a[data-project]").on("click",function(t){t.preventDefault();var e=$(this).data("project");if(e==$("#leftnav").data("project"))return;$("#leftnav").data("project",e);var a=$(this).parent("li");$.get(window.BACKEND_URL+"/project/"+e,{partial:1},function(t){if(t.Code!=1){App.message({title:App.i18n.SYS_INFO,text:t.Info,type:"error"});return}$("#leftnav").html(t.Data.list);App.initLeftNav();App.initLeftNavAjax(window.activeURL,"#leftnav");a.siblings("li.active").removeClass("active");a.addClass("active")},"json")})});